@marklevinshow We need to stop all early voting, no mail in voting except for absentee ballots.
Eliminate all types of ballot/vote harvesting. Vote in person with a voter ID.
Keep it simple.

@BenWinegard Right. Which goes to question you’ve raised:

Do we hold Trump or the Woke more responsible for activists with this belief &amp; motivation?

FTR, effect of mail ballot harvesting by D activists in swing states muddies R claims of fraud, since many of these ballots are for real RVs.
